import React, { Component } from 'react';
import {firebaseone} from '../../firebaseconnectio';
class diaPhuong extends Component {

    constructor(props) {
        super(props);
        this.state = {
            data : [],
            data24 : [],
            data34 : [],
            data44 : [],
            data54 : [],
            data64 : [],
            datasun : []
        };
    }
    YearGetNew = () => {
        return new Date().getFullYear();
      }
    componentWillMount() {
        firebaseone.on('value',(datas) => {
            var Mang001 = [];
            var Mang002 = [];
            var Mang004 = [];
            var Mang006 = [];
            var Mang008 = [];
            var Mang010 = [];
            var Sun = [];
            datas.forEach(element => {
                const key = element.key;
                const dob = element.val().id;
                const demso =  dob.slice(3);
                if(demso === "001")
                {
									Mang001.push({
                        key : key,
                        dob : dob
                    })
                }
                if(demso === "002")
                {
										Mang002.push({
                        key : key,
                        dob : dob
                    })
                }
                if(demso === "004")
                {
                    Mang004.push({
                        key : key,
                        dob : dob
                    })
                }
                if(demso === "006")
                {
                    Mang006.push({
                        key : key,
                        dob : dob
                    })
                }
                if(demso === "008")
                {
                    Mang008.push({
                        key : key,
                        dob : dob
                    })
                }
                if(demso === "010")
                {
									Mang010.push({
                        key : key,
                        dob : dob
                    })
								}
								if(demso === "011")
