                        dob : dob
                    })
								}
								if(demso === "027")
                {
									Mang027.push({
                        key : key,
                        dob : dob
                    })
								}
								if(demso === "030")
                {
									Mang030.push({
                        key : key,
                        dob : dob
                    })
								}
								if(demso === "031")
                {
									Mang031.push({
                        key : key,
                        dob : dob
                    })
								}
								if(demso === "033")
                {
									Mang033.push({
                        key : key,
                        dob : dob
                    })
								}
								if(demso === "034")
                {
									Mang034.push({
                        key : key,
                        dob : dob
                    })
								}
								if(demso === "035")
                {
									Mang035.push({
                        key : key,
                        dob : dob
                    })
								}
								if(demso === "036")
                {
									Mang035.push({
                        key : key,
                        dob : dob
                    })
								}
								if(demso === "037")
                {
									Mang035.push({
                        key : key,
                        dob : dob
                    })
                }
                Sun.push({
                    key : key
                })
            });
            this.setState({
                data : Mang,
                data24 : Mang24,
                data34 : Mang34,
                data44 : Mang44,
                data54 : Mang54,
                data64 : Mang64,
                datasun : Sun
            });
        })
    }

    phantich = () => {
        let tongthe = this.state.datasun.length;
        let thuctai = this.state.data.length;
        return Math.ceil((thuctai / tongthe) * 100);
    }

